import { useState } from 'react'

const useCount = () => {
    const [count, setCount] = useState(0)
    const increment = () => {
        setCount((prevCount) => prevCount + 1)
    }
    const decrement = () => {
        setCount((prevCount) => prevCount - 1)
    }
    const reset = () => {
        setCount(0)
    }
    return [count, increment, reset, decrement]
}

export default useCount
